window.bookSummaryJSON = "<p>With many challenges, trials, and tribulations riddling their path, Asterios and the girls successfully made it through the realm of valkyrjas and reached the Descending Spire's final floor. The task to pierce the inverted tower's defenses was an arduous one but provided them with some great revelations about Ast's past and his true identity. At the same time, Bryn discovered something new too. Now, with their main goal secured, they have a lot to think about before returning home...</p> <p>But are they going to finally find a moment of respite after doing so? Is everything alright back in Glimmervale? There's only one way to check and our adventurous party certainly isn't going to shy away from more trouble, be it from new or old friends and foes.</p> <p>With how much they had learned during their expedition, they certainly have many options to explore.</p>"; 
